My next guest on Book Club is the one and only @adam.two whose refreshing sets have consistently stood out to me as forward thinking and fun snapshots of percussive based modern dance music. I am very excited to have them on the show and hope you can tune in @bsidedotradio 7-8pst Tues night.

Adam runs @afrofuturismisnow & @pprz.records and is a tastemaker in Vancouver. Check out their links and tune in to BookClub for their set!

